import React from 'react';
import "../Asserts/Css/Pages/Home.css";
import IIEC_logo from "../Asserts/images/IIEC_logo.png";
import map from "../Asserts/images/Map.png";

const Home =()=>{
   return (
       <div className='home_page'> 
           <div className='home_header'>
              <img className='logo_img' src={IIEC_logo}></img>
              <input className='home_inputs' placeholder='search' type= "text" />
            
             </div>

           <div className='home_headings'>
             
           </div>
           <div className='home_map'>
               <img className='home_mapbanner' src={map}></img>
           </div>
            
       </div>
   )
}
export default Home ;


